import React from 'react'
import './Account.css'
import backIcon from '../assets/previous.png'
import {Link} from 'react-router-dom'

const Header = (props) => {
    return(
        <div className="Header">
            {props.header}
            <Link onClick={()=>{this.props.history.goBack()}}><img src={backIcon} alt='back' className='header-img' /></Link>
        </div>
    )
}

export default Header
